import React from "react";

const FilterPrice = () => {
  const radios = [
    {
      id: 1,
      name: radio_one,
    },
    {
      id: 2,
      name: radio_two,
    },
    {
      id: 3,
      name: radio_three,
    },
  ];

  return <div>FilterPrice</div>;
};

export default FilterPrice;
